<!DOCTYPE html>
<html lang="en">
<head>
  <title>IceHe's Library</title>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="IceHe's Library">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
  <link rel="shortcut icon" type="image/x-icon" href="https://cdn.icehe.xyz/_docsify/h-favicon.ico" />
  <link rel="stylesheet" href="docsify/resource/__unpkg.com_docsify@4_lib_themes_vue.css">
  <link rel="stylesheet" href="docsify/resource/__unpkg.com_docsify-darklight-theme@latest_dist_style.min.css"
    title="docsify-darklight-theme" type="text/css" />
</head>
<body>
  <div id="app">Loading …</div>
  <script>
    window.$docsify = {
      auto2top: true, 
      basePath: '.', 
      coverpage: 'docsify/_coverpage.md', 
      onlyCover: true, 
      formatUpdated: "{YYYY}/{MM}/{DD} {HH}:{mm}", 
      loadNavbar: 'docsify/_navbar.md', 
      markdown: { 
        smartLists: true,
        smartypants: true,
      },
      mergeNavbar: false, 
      notFoundPage: 'docsify/_404.md', 
      search: {
        depth: 6, 
        maxAge: 86400000, 
        noData: 'No Results!',
        paths: 'auto',
        placeholder: 'Type to search',
      },
      plantuml: {
        skin: 'classic',
      },
      plugins: [
        function (hook, vm) {
          hook.beforeEach(function (content) {
            var toEdit = [
              '\n',
              '{docsify-updated}',
              ' | ',
              '[view](',
              'https://github.com/IceHe/lib/blob/master',
              vm.route.file, ')',
              ' source or ',
              '[edit](',
              'https://github.dev/IceHe/lib/blob/master',
              vm.route.file, ')',
            ].join('');
            var footer = [
              '&copy; ' + new Date().getFullYear() + ' IceHe.xyz',
              '\u2726 You\'re free to be free.',
              '\u101C <a href="https://beian.miit.gov.cn/" style="color: inherit; font-weight: normal; text-decoration: none;">京 ICP 备 18038982 号</a>',
              '',
            ].join(' <br/> ');
            return [
              toEdit, '\n',
              content,
              '\n\n----\n\n',
              footer,
            ].join('')
          });
        },
      ]
    }
  </script>
  <script src="docsify/resource/__unpkg.com_docsify@4"></script>

  <script src="docsify/resource/__unpkg.com_docsify_lib_plugins_zoom-image.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-applescript.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-bash.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-c.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-cpp.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-docker.min.js"></script>

  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-jsx.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-kotlin.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-markdown.min.js"></script>
  <script src="docsify/resource/__unpkg.com_prismjs_components_prism-nasm.min.js"></script>
